window.bookSummaryJSON = "<p><b>Accepting fate is the only way forward.</b></p> <p><b>Cait</b></p> <p>I thought I knew what I needed, but all it took was one kidnapping and a near-death experience to show me how wrong I’d been. Wrong about my new life, the people in it, and who I was supposed to be.</p> <p>I’m finally the supernatural I was meant to be - even if things hadn’t gone as planned. Now, it’s time to release my control and see what happens when I let go.</p> <p><b>Roman</b></p> <p>Losing Cait awoke a fear inside me I’d never known existed before. She’s become more than I ever expected, and yet nothing is working out how I wanted.</p> <p>Trouble awaits us at every turn, and the harder I try to protect Cait, the worse things seem to get. When left with no other choice, I’ll have to trust fate even as everything is falling apart around us.</p>"; 
